import { AppBar, Container, Typography, Select, Toolbar, MenuItem} from '@mui/material'
import React from 'react'
import { makeStyles } from '@mui/styles';
import '../App.css';
import { useHistory } from 'react-router-dom';

const useStyles = makeStyles(() => ({}));

const Header = () => {
  const history = useHistory();
  const classes = useStyles();
  return (
    <AppBar color="transparent" position="static">
      <Container>
        <Toolbar>
          <Typography onClick={()=>history.push} id="title" className={classes.title}>Bitcoin Today</Typography>
            <Select variant="outlined" style={{width:100,height:40,marginLeft:15}} >
            <MenuItem value={"USD"}>USD</MenuItem>
            <MenuItem value={"EUR"}>EUR</MenuItem>
           </Select>
          </Toolbar>
        </Container>
      </AppBar>
  )
}

export default Header
